import React from 'react';
import {Body, Button, Header, Icon, Left, Right, Title} from "native-base";

const AppHeader = ({...props}) => {
    {/*TODO: Terminar estilo de la barra*/}
    return <Header style={{
        backgroundColor: '#1175EE',
        paddingLeft: 20,
        paddingRight: 20,
        height: 70
    }}>
        <Left>
            <Button transparent>
                <Icon style={{
                    color: '#fff'
                }} name='menu' />
            </Button>
        </Left>
        <Body>
            <Title style={{
                color: '#fff',
                flex:1,
             justifyContent:'center'
            }}>Prueba</Title>
        </Body>
        <Right>
            <Button transparent>
                <Icon style = {{color:'#ffff'}}name='menu'/>
            </Button>
        </Right>
    </Header>;
};

export default AppHeader;
